import React from 'react';

const FooterComponent = () => {
  return (
    <footer className="main-footer">
      <div className="footer-content">
        <span>TinderLink | All Right Reserved &copy; {new Date().getFullYear()}</span>
      </div>
    </footer>
  );
};

export default FooterComponent;
